import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { CookiesPolicyRoutingModule } from './cookies-policy-routing.module';


@NgModule({
  declarations: [],
  imports: [
    CommonModule,
    CookiesPolicyRoutingModule
  ]
})
export class CookiesPolicyModule { }
